import axios from "axios";
import { useEffect, useState } from "react";

export default function Topings() {
  const [topingsData, setTopingsData] = useState([]);
  console.log(topingsData);
  useEffect(() => {
    axios
      .get("http://localhost:3030/toppings")
      .then((res) => setTopingsData(res.data));
  }, []);
  return (
    <>
      <div className="container row my-5">
        <h1>Sos Cesitleri</h1>
        <p>Tanesi: 1$</p>
        <h2>Soslarin Ucreti: 0$</h2>
        <div className="d-flex align-items-center justify-content-between gap-3 ">
          {topingsData.map((toping) => (
            <div className="d-flex flex-column align-items-center justify-content-between gap-3">
              <img src={toping.imagePath} />
              <p>{toping.name}</p>
            </div>
          ))}
        </div>
      </div>
    </>
  );
}
